import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let posts = [
    { message: "Congratulation!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
    { message: "YOU'VE DONE IT!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
  ]

ReactDOM.render(<App posts={posts}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
